import './App.css';
import * as React from 'react';
import ActionAreaCard from '../src/Components/ActionAreaCard';
import TextField from '@mui/material/TextField';
import MultipleSelectCheckmarks from '../src/Components/Tags';
import { useState, useEffect } from 'react';
import { usePapaParse } from 'react-papaparse';
import BasicSelect from './Components/Accordian';
import { FixedSizeList } from 'react-window';
import { data } from './clubs';

function App() {
  const [nameUserInput, setNameUserInput] = useState('');
  const [descriptionUserInput, setDescriptionUserInput] = useState('');

  const handleNameInputChange = (event) => {
    setNameUserInput(event.target.value);
  };

  const handleDescriptionInputChange = (event) => {
    setDescriptionUserInput(event.target.value);
  };

  const { readString } = usePapaParse();
  const [card_info, updateCardInfo] = useState([]);

  useEffect(() => {
    const csvString = data;

    readString(csvString, {
      worker: true,
      complete: (results) => {
        const card_info = results.data
          .map((cardData) => {
            const innerArray = cardData.slice(2);
            return [cardData[0], cardData[1], innerArray];
          })
          .filter(Boolean); // Remove any empty values
        updateCardInfo(card_info);
      },
    });
  }, []);

  const textArray = card_info;

  const text_array_new = textArray.filter((el) => {
    if (nameUserInput === '') {
      return el;
    } else {
      const to_check = el[0].toLowerCase();
      return to_check.includes(nameUserInput);
    }
  });

  const descriptions_array = textArray.filter((el) => {
    if (descriptionUserInput === '') {
      return el;
    } else {
      const to_check = el[1].toLowerCase();
      return to_check.includes(descriptionUserInput);
    }
  });

  const [personName, setPersonName] = React.useState([]);

  let tags_array = [];

  tags_array = card_info.filter((el) => {
    if (personName.length === 0) {
      return el;
    } else {
      return personName.some((tag) => el[2].includes(tag));
    }
  });

  const [age, setAge] = useState('');

  const handleChangeTags = (event) => {
    const {
      target: { value },
    } = event;
    setPersonName(typeof value === 'string' ? value.split(',') : value);
  };

  const handleChange = (event) => {
    setAge(event.target.value);
  };

  return (
    <div className="container mx-auto bg-gray-200 rounded-xl shadow border p-8 m-10" id="clubs_holder">
      <p className="text-3xl text-gray-700 font-bold mb-5">Welcome!</p>

      <BasicSelect age={age} handleChange={handleChange} />

      {age === 10 && (
        <TextField label="Type in a name.." value={nameUserInput} onChange={handleNameInputChange} sx={{ paddingBottom: '10px' }} />
      )}
      {age === 20 && (
        <TextField label="Type key words..." value={descriptionUserInput} onChange={handleDescriptionInputChange} sx={{ paddingBottom: '10px' }} />
      )}
      {age === 30 && <MultipleSelectCheckmarks personName={personName} handleChange={handleChangeTags} />}

      <div className="card-container">
        {age === 10 && (
          <FixedSizeList
            height={400}
            width={800}
            itemSize={100}
            itemCount={text_array_new.length}
          >
            {({ index, style }) => (
              <div style={style}>
                <ActionAreaCard
                  key={index}
                  title={text_array_new[index][0]}
                  description={text_array_new[index][1]}
                  tags={text_array_new[index][2]}
                />
              </div>
            )}
          </FixedSizeList>
        )}

        {age === 20 && (
          <FixedSizeList
            height={400}
            width={800}
            itemSize={100}
            itemCount={descriptions_array.length}
          >
            {({ index, style }) => (
              <div style={style}>
                <ActionAreaCard
                  key={index}
                  title={descriptions_array[index][0]}
                  description={descriptions_array[index][1]}
                  tags={descriptions_array[index][2]}
                />
              </div>
            )}
          </FixedSizeList>
        )}

        {age === 30 && (
          <FixedSizeList
            height={400}
            width={800}
            itemSize={100}
            itemCount={tags_array.length}
          >
            {({ index, style }) => (
              <div style={style}>
                <ActionAreaCard
                  key={index}
                  title={tags_array[index][0]}
                  description={tags_array[index][1]}
                  tags={tags_array[index][2]}
                />
              </div>
            )}
          </FixedSizeList>
        )}
      </div>
    </div>
  );
}

export default App;
